import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import LoginComponent from './components/login.component';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import OverviewComponent from "./components/overview.component";
import ItemViewComponent from "./components/item-view.component";
import UserFormComponent from "./components/user-form.component";

class App extends Component{
  render() {
    return (
        <Router>
            <Switch>
                <Route exact path="/login" component={LoginComponent}/>
                <Route exact path="/overview" component={OverviewComponent}/>
                <Route exact path="/items" component={ItemViewComponent}/>
                <Route exact path="/users/add" component={UserFormComponent}/>
            </Switch>
        </Router>
    );
  }
}

export default App;
